INSERT INTO `pattern_ai` (`id`, `pattern_ai`, `function`) VALUES
(1, 'drugi_ai', '\n    $owner_count_1x1 = $board->find_nearby_fields($x, $y);\n    $neutral_field = 0;\n    $friendly_field = $player->game_id;\n    $enemy_field = $player->enemy;\n\n    $neutral_fields = $owner_count_1x1[0];\n    $friendly_fields = $owner_count_1x1[$friendly_field];\n    $enemy_fields = $owner_count_1x1[$enemy_field];\n    $priority = 1;\n    if ($friendly_fields <= 3)\n        $priority += 1;\n    if ($enemy_fields >= 1)\n        $priority += 1;\n    if ($neutral_field >= 5)\n        $priority += 1;\n\n    return $priority;\n\n'),
(2, 'function_return_1', '\r\n    return 1;\r\n');
