(2, '9 likov iz videoiger, ki bazirajo na resniÄnih ljudeh', 'Od predsedniÅ¡kih korenin Sonica, do povezave med Laro Croft in Å vedsko reperko iz 80-ih, tukaj je 10 likov iz videoiger za katere zagotovo niste vedeli, da so nastali na podlagi resniÄnih ljudi.', '2017-05-06 21:57:05', 375, 'Miko'),
(6, 'OnePlus 5 ima vse moÅ¾nosti, da postane najboljÅ¡i Android!', 'Pri podjetju OnePlus so konec lanskega leta pripravili enega najzmogljivejÅ¡ih&nbsp;pametnih mobilnih telefonov Android, ki temelji na osnovi predhodne uspeÅ¡nice OnePlus 3. Govorimo o pametnem mobilnem telefonu OnePlus 3T, katerega glavna prednost je procesor Snapdragon 821. Z njim so namreÄ uporabniki pridobili tako veÄjo zmogljivost kot veÄjo avtonomijo delovanja, saj je Snapdragon 821 pri delovanju energijsko znatno bolj varÄen od predhodnika Snapdragon 820. CenejÅ¡i model ima za shranjevanje podatkov na voljo 64 gigabajtov prostora, draÅ¾ji pa kar 128 gigabajtov. Novost bo tudi kot nalaÅ¡Ä za zajemanje videoposnetkov in fotografij, saj jo bodo inÅ¾enirji opremili z digitalnim tipalom loÄljivosti 16 milijonov slikovnih toÄk.Ker pa se pametni mobilni telefon OnePlus 3T ne more veÄ uspeÅ¡no kosati s paradnimi konji vodilnih proizvajalcev, bo kmalu naprodaj njegov naslednik, ki bo opremljen z oznako&nbsp;OnePlus 5. NajnovejÅ¡e govorice kaÅ¾ejo na to, da bo novost po vsej verjetnosti opremljena z zmogljivim procesorjem Qualcomm Snapdragon 835, sistemskim pomnilnikom kapacitete Å¡est gigabajtov in vgrajeni pomnilnik z do 128 gigabajti prostora. Tu bo seveda na voljo tudi bralnik prstnih odtisov in vse redkeje uporabljen 3,5-milimetrski prikljuÄek za sluÅ¡alke. Za prikazovanje slik bo po vsej verjetnosti Å¡e vedno na voljo 14-centimetrski oziroma 5,5-palÄni zaslon visoke loÄljivosti.Dolgo avtonomijo delovanja naj bi pametnemu mobilnemu telefonu OnePlus 5 zagotavljala baterija zmogljivosti 3.600 miliamper ur, ki jo bomo lahko polnili kar 25 odstotkov hitreje kot pri modelu OnePlus 3T. Za zajem superkakovostnih fotografij pa bosta na volj okar dva digitalna fotoaparata loÄljivosti 16 milijonov slikovnih toÄk, ki bosta postavljena v navpiÄni poloÅ¾aj. Zanimivi pametni mobilni telefon OnePlus 5 naj bi na trg prispel Å¡e letos poleti.', '2017-05-07 17:04:45', 89, 'Miko'),
(142, 'Google raises heat on Microsoft with new Chrome bundle for enterprises', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>Google on Tuesday rolled out an enterprise bundle that packages Chrome, management templates and an add-on for dealing with legacy sites and apps, building on the chokehold its browser has on the web.</p><p>The collection -- prosaically dubbed "enterprise bundle" -- includes a Chrome installer (in .msi format), the Legacy Browser Support (LBS) add-on, and a set of templates for applying group policies to Chrome within the company. It was essentially a convenience, since all its components have been available separately.</p><aside class="fakesidebar"><strong>[ More reading: <a href="http://www.computerworld.com/article/3146152/enterprise-applications/microsoft-word-vs-google-docs-which-works-better-for-business.html#tk.ctw-infsb">Microsoft Word vs. Google Docs: Which is better for business?</a> ]</strong></aside><p>"The new bundle includes multiple tools in a single download that IT admins need for a simple, managed deployment," boasted Matt Blumberg, a Chrome product manager on Google''s enterprise and education team, in a <a href="https://blog.google/topics/connected-workspaces/chrome-browser-enterprise-new-admin-bundle-and-citrix-support/" target="_blank">post to a company blog</a>.</p><p>"Every couple of years, Google makes noise about Chrome in the enterprise," said Gary Schare, president of Browsium, a maker of browser management tools. Schare was formerly the head ofÂ product management for Microsoft''s Internet Explorer (IE). "This looks like Google is trying to make Chrome a better citizen in the enterprise."</p><aside class="nativo-promo smartphone" id=""> </aside><p>Schare applauded the group policy templates, noting that because Microsoft''s own browsers, IE as well as Windows 10''s Edge, have traditionally been the best equipped for enterprise management, any help from Google on Chrome would be welcome.</p><p>The LSB add-on has long been <a href="https://chrome.google.com/webstore/detail/legacy-browser-support/heildphpnddilhkemkielfhnkaagiabh?hl=en" target="_blank">available from the Chrome Web Store</a>, Google''s authorized mart for browser extensions. Once configured by company IT administrators, LSB will automatically open IE11 when links clicked within Chrome lead to websites, web services or web apps requiring, for example, an ActiveX control or Java, neither of which Google''s browser supports.</p><p>"When they''re done with the legacy app and type in other URLs that are not specified by the admin, LBS will switch the user back to Chrome," Blumberg explained.</p><p>Browsium calls that "traffic routing," the purpose of the Redmond, Wash. firm''s first app, Catalyst. Schare acknowledged that Google''s free LSB is similar to Catalyst, but argued that the latter offers more granular control over what version of the IE rendering engine is called up in specific circumstances.</p><aside class="nativo-promo tablet desktop" id=""> </aside><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155340757729680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p>According to every available metric, Chrome is the most popular browser on the planet. Analytics vendor Net Applications, for instance, pegged its <i>user share</i>, a proxy for the percentage of the world''s desktops that opened Chrome during April, at 59%, a record. As recently as a year ago, Microsoft''s duo of IE and Edge topped the user share chart; Chrome''s share exploded in 2016, largely because Microsoft gave users a Hobson''s choice of upgrading to a newer version of IE.</p><p>Instead, millions decided to switch browsers.</p><p>But Schare said IE is still king of the enterprise browsers. "IE is still the primary browser," he asserted, even though Microsoft has reduced it to legacy status. "It''s still an IE world in the enterprise, although there have been dramatic increases in Chrome."</p><p>The reason? Schare cited the huge number of web apps and intranet websites designed for old, now-defunct versions of IE. Because IE11 is -- more or less -- backwards compatible, and rivals like Chrome or Mozilla''s Firefox are decidedly not, companies stick with Microsoft''s browser rather than spend money to rewrite the apps and sites.</p><p>But Gartner Research disagreed with Schare''s contention that IE remains top dog. "Chrome is the de facto standard in the enterprise," said Michael Silver, a Gartner analyst, in a Tuesday interview. "Yes, IE is still in use, but because it has to be."</p><p>Two years ago, <a href="http://www.computerworld.com/article/2932672/web-browsers/ie-loses-stranglehold-on-the-enterprise-as-chrome-makes-major-inroads.html">Gartner forecast that Chrome would surpass IE</a> in enterprise usage by the end of 2015. That, in fact, came to pass.</p><p>Like Schare, whose company''s business model is predicated on multiple browsers within enterprises, Silver and Gartner have long recommended a two-browser strategy: One to handle legacy apps and sites, the other for everything else. Doing so lets employees access the old but does not punish them by making them access the web with a creaky, sub-standard browser. In that model, whether Schare''s or Silver''s, IE clearly plays the legacy role.</p><p>"[Enterprises] need both the legacy browser and a modern one," Silver said.</p><p>It was only in 2015 that Microsoft offered its own "modern" browser, Edge, and pitched dual workplace browsers. But because Edge runs only on Windows 10, and because Windows 10 has yet to make a meaningful appearance on corporate PCs, the pair are unavailable to most customers. Thus, Chrome''s climb.</p><p>"We really don''t see Edge yet [used by our customers], because we really don''t see Windows 10 yet," Schare said.</p><p>Silver echoed that. "We don''t find enterprises defaulting to Edge," he said of those that have moved to Windows 10. "They''re more likely to let users pick whatever they want to use" for the "modern" half of the browser duo.</p><p><a href="https://enterprise.google.com/chrome/chrome-browser/" target="_blank">Google''s Chrome enterprise bundle</a> can be downloaded from the company''s website. Chrome and the group policy templates can also be downloaded separately from the same site.</p> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:21', 12, 'Admin'),
(143, 'Former NSA chief weighs in on cybersecurity, cyberespionage at ZertoCon', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>BOSTON -- Retired Gen. Michael Hayden held nothing back when speaking to cybersecurity pros today at the <a href="http://www.zerto.com/zertocon/" target="_blank">ZertoCon business continuity conference</a>.</p><p>It''s been more than a decade since he led the National Security Agency (NSA), but that didn''t stop Hayden from asserting that the Russians were involved in last year''s U.S. presidential election. His view: Only two presidents doubt that the Russians were involved in the 2016 election -- Donald Trump and Vladimir Putin.</p><p>"They [the Russians] had an affect on the election, there is no question that this happened," Hayden said. "The question is if there was collaboration with the campaign."</p><p>He offered no apologies when asked about the NSA''s surveillance programs, nor did he agree with the release of documents by former NSA employee Edward Snowden. Hayden argued that Snowden could have gone to Congress with his privacy concerns, calling what he did "really destructive."</p><aside class="nativo-promo smartphone" id=""> </aside><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155340462524680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p>"We are one of the most active cyberespionage countries in the world. We are really good at stealing stuff," Hayden went on, stressing that what was released by Snowden did not show the NSA was doing any illegal surveillance of American citizens.</p><p>During his talk, Hayden covered a variety of topics:</p><ul> <li>He talked about the use of cyberespionage in attacking Iran''s nuclear facility and in a tongue-and-cheek way said he "really admires who may have done that." He was referring to Stuxnet, which was <a href="http://www.computerworld.com/article/2503837/government-it/report--obama-ordered-stuxnet-attacks-on-iran.html">reportedly designed to take down Iran''s nuclear program</a>.</li> </ul><ul> <li>He said the first words that come to mind when he thinks about President Trump are that the president is "a little scary."</li> </ul><ul> <li>And he noted that terrorist attacks in other nations usually reverbate worldwide. "There is a bump in Manchester (England), and then it goes bang in North America," he said, referring to a bomb attack at a concert in Manchester, England Monday night. "It makes us go to the news to say, ''What happened tonight.''"</li> </ul><p>Hayden, who in addition to running the NSA is also a former director of the CIA, also said the private sector''s involvement will be needed to fend off future cyberattacks. He argued that the leaders of Google, Apple and Facebook can move much faster than the U.S. government in staving off threats.</p><p>"We need your genius to make us safe in the cyber domain," he said.</p><aside class="nativo-promo tablet desktop" id=""> </aside> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:21', 7, 'Admin'),
(144, 'The value of metadata â€“ the most Instagrammed tourist attractions globally', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>Edward Snowdenâ€™s revelations about federal interception of private electronic transmissions started to build public awareness about the concept of â€œmetadata.â€ The simple concept suddenly has people thinking about the data relating to the data they are generating and sharingâ€”and the insights that could be gleaned from that.</p><p>A few weeks ago, I received an email from online travel company TravelBird asking me whether I was interested in a report detailing some metadata analysis they had done on Instagram posts. The pitch intrigued me for a few reasons: first, Iâ€™m interested in the insights that data can generate. Second, Iâ€™m a huge proponent of travel and traveling experiences as life-changing events. Third, Iâ€™m a big fan of using Instagram to document my travels, running and nature experiences (if youâ€™re so inclined, feel free to check out my feed <a href="http://instagram.com/benkepes">here</a>.)</p><p>TravelBird released a <a href="https://travelbird.nl/the-most-instagrammed-tourist-attractions/">study</a> which ranks 470 popular global attractions and measures their relative Instagram coverage. An analysis of Instagram tags helped TravelBird generate this report. It is, of course, valuable to the travel industry which can use it for developing offerings and the like. TravelBird analyzed popular attractions in 10 different counties and created a master ranking comparing 400 of the worldâ€™s most popular tourist destinations based on their Instagram presence.</p><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155340020294680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p>â€œThis study offers a compelling overview of hundreds of destinations that are beloved by Instagram users for their cultural heritage, their stunning natural beauty and their local charm,â€ states Symen Jansma, Founder of TravelBird. â€œAlongside this, the data also tells a fascinating story about the ways people are traveling in 2017, offering valuable insights for the travel and tourism industry.â€</p><aside class="nativo-promo smartphone" id=""> </aside><p>And the results? The list of 15 is below, but, spoiler alert, perhaps unsurprisingly man-made locations take out the top three slots, with Disneyland, the Eiffel Tower and Walt Disney World sharing the podium. Happily, at least for this nature lover, some natural attractions make the top 15 including Floridaâ€™s South Beach, Niagara Falls and the Grand Canyon.</p><p>While interesting for its own sake, this report is yet another example of just how much can be gleaned from metadata. Now all TravelBird needs to do is cross-reference those results to the different itineraries that people use on their travels, the sort of accommodation they stay at and the meals they eat. From all of that, they can create some targeted and customized offers. And we thought that all we were doing was sharing photosâ€¦</p> <p><strong>This article is published as part of the IDG Contributor Network. <a href="/contributor-network/signup.html">Want to Join?</a></strong></p> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:22', 6, 'Admin'),
(145, 'Hands on: Android O&#039;s most useful features (so far)', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>With Google I/O officially behind us, it''s time to start looking forward -- and that means time to start thinking in more detail about the next major version of Android and what it''ll mean for us.</p><p><a href="http://www.computerworld.com/article/3197468/artificial-intelligence/google-home-io-2017.html">Google Home</a> and <a href="https://blog.google/products/photos/google-photos-500-million-new-sharing/" target="_blank">Photos</a> may have stolen the show at last week''s conference, but the already-under-development <a href="http://www.computerworld.com/article/3183589/android/google-android-o-preview.html">Android O</a>Â certainly had its share of the spotlight. We''ve known about Android O for a while now, of course -- ever since the <a href="https://android-developers.googleblog.com/2017/03/first-preview-of-android-o.html" target="_blank">first developer preview</a> of the software plopped out back in March -- but at I/O, Android O officially entered its beta phase and became <a href="http://www.android.com/beta" target="_blank">readily available</a> to anyone with a recent Nexus or Pixel phone.</p><p>Android O isn''t quite ready for public consumption, mind you -- it''s still <a href="https://developer.android.com/preview/release-notes.html#general" target="_blank">a bit rough around the edges</a>, and if you use it enough, you''re bound to encounter areas that don''t yet work as intended -- but the software is now close enough to its final form that you don''t have to be a <em>total </em>daredevil to try it out on a phone you''re actually carrying.</p><p>I''ve been spending some time getting to know Android O a bit more intimately over the past several days (in a PG-only sense, I swear). And while the release packs plenty of surface-level polish and under-the-hood tuning, it''s a pair of easily overlooked features that''s made the most impact on my day-to-day life so far:</p><aside class="nativo-promo smartphone" id=""> </aside><h3>1. Notification snoozing</h3><p>You <a href="http://www.computerworld.com/article/3183634/android/android-o-notifications.html">knew this one was coming</a>, right? I''ve been <a href="http://www.computerworld.com/article/3039469/android/android-n-notifications.html">talking about my burning desire</a> for native Android notification snoozing ever since I fell in love with the snoozing function in <a href="http://www.computerworld.com/article/2969657/google-apps/google-inbox-9-months-later.html">Google''s Inbox app</a> many months back. With Android O, my wish is a reality.</p><p>When you see a notification in O that''s important but not something you want to deal with immediately, you can simply swipe it slightly to either side to reveal a new clock icon. Tap that icon, and ta-da: You''ll find the option to send the notification away and have it reappear a little while later.</p><figure class="large"><img src="http://images.techhive.com/images/article/2017/05/android-o-features-notification-snoozing-100723444-large.jpg" border="0" alt="Android O Features: Notification Snoozing" width="700" height="613" data-imageid="100723444"/> <small class="credit">jr</small></figure><p>By default (for now, at least), Android O snoozes all notifications for 15 minutes. Tap the little arrow next to that time, though, and you can opt to change the window to 30 minutes or an hour.</p><figure class="large"><img src="http://images.techhive.com/images/article/2017/05/android-o-features-notification-snoozing-time-100723445-large.jpg" border="0" alt="Android O Features: Notification Snoozing Time" width="700" height="613" data-imageid="100723445"/> <small class="credit">jr</small></figure><p>Ideally, I''d love to see even more robust snoozing options, like what we have in Inbox -- things like the ability to snooze a notification until a specific time and date or to set a notification to reappear when you''re in a particular location -- but remember that this is still only the first beta version of this feature. What we''re seeing now is a powerful first step toward making alerts more useful.</p><aside class="nativo-promo tablet desktop" id=""> </aside><p>Think about it in real-world terms: Let''s say you get an important Slack message while you''re in a meeting -- maybe something from your boss asking you to call her when you''re free. You read it, but you know you won''t have a chance to deal with it for another half an hour. And you don''t want to forget.</p><p>Now, instead of having to awkwardly leave the notification in place and hope it catches your eye again -- or, if your brain is as perpetually frazzled as mine, set a <em>separate</em> reminder for yourself as a fail-safe -- you can simply swipe that notification to the side and tell Android to bring it back to your attention in 30 minutes.</p><p>Easy peasy, right? From a productivity perspective, this really may be Android O''s most impressive feature.</p><h3>2. Picture-in-picture mode</h3><p>Android''s had a native split-screen function since last year''s Nougat release (and third-party manufacturers have been baking that sort of feature into their own software for even longer), but Android O''s picture-in-picture mode is a much more practical way to multitask on a smaller-screen device when it comes to a limited and specific set of tasks.</p><p>The way it works is pretty thought-free and automatic: Imagine you''re watching an important professional development video in YouTube (because that''s the only type of video you''d ever watch from your work phone, obviously) -- and you decide you want to send a message to someone or go look something up in Chrome without stopping playback. Just hit your Home or Overview key, and bam: The video will shrink down into a small floating box over your home screen or recent apps list, and you can go about your other business while continuing to watch.</p><figure class="large"><img src="http://images.techhive.com/images/article/2017/05/android-o-features-picture-in-picture-100723446-large.jpg" border="0" alt="Android O Features: Picture in Picture" width="700" height="613" data-imageid="100723446"/> <small class="credit">jr</small></figure><p>Open any other app you want, and the floating box will remain in place. You can even drag it around the screen to position it wherever you like. And when you want the box to go away, you just fling it toward the bottom of your screen to dismiss it.</p><figure class="large"><img src="http://images.techhive.com/images/article/2017/05/android-o-features-picture-in-picture-video-100723450-large.jpg" border="0" alt="Android O Features: Picture in Picture Video" width="700" height="613" data-imageid="100723450"/> <small class="credit">jr</small></figure><p>With YouTube, it looks like you''ll have to have an active <a href="https://support.google.com/youtube/answer/6305537?co=GENIE.Platform%3DAndroid&amp;hl=en" target="_blank">Play Music/YouTube Red subscription</a> in order for the option to be available. But picture-in-picture mode itself is a system-level feature, so YouTube is but one example of how the technology could end up serving you.</p><p>Two other apps with confirmed picture-in-picture support in the works are Netflix (for obvious purposes) and Maps (for keeping navigation on your screen while you do other things), though neither works for me just yet. Google''s Duo chat app also apparently supports the feature already, but -- <a href="http://www.computerworld.com/article/3107981/android/google-duo-video-chat-app.html">well, y''know</a>. With any luck, more titles will get on board once Android O is actually out in the wild.</p><p>The simplest way to think about picture-in-picture mode is as a less space-consuming and interface-disrupting way to view multiple things on your screen at once. It won''t make sense for everything, but with certain scenarios, it''s easy to see how it could enhance your productivity (and/or time-wasting) potential.</p><p>And that''s exactly the sort of feature I get excited about, my Android-toting compadres. We can talk all day about the theoretical performance improvements and stamina enhancements every company promises <a href="https://twitter.com/JRRaphael/status/864911363218558977" target="_blank">in every OS release</a>, but it''s the practical touches -- the ones that make our lives easier in small but meaningful ways -- that really add up.</p><p>If you''ve chosen a phone from <a href="http://www.computerworld.com/article/3175067/android/android-upgrade-problem.html">a manufacturer that makes timely upgrades a priority</a>, you''ve got some promising stuff to look forward to this summer.</p><figure class="large"><a href="https://twitter.com/androidintel" target="_blank"><img src="http://images.techhive.com/images/article/2016/11/android-intelligence-twitter-100694107-orig.jpg" border="0" alt="Android Intelligence Twitter" width="620" height="57"/></a></figure> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:22', 2, 'Admin'),
(146, 'Apple, iOS, and IBM are transforming retail, one shop at a time', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>Yet more evidence proves Apple has become a peer <a href="http://www.computerworld.com/article/3197626/apple-ios/15-reasons-apple-leads-the-mobile-enterprise.html">enterprise technology vendor</a>, this time in the shape of an <a href="http://www.apple.com/business/mobile-enterprise-apps">Apple</a> and <a href="https://www.ibm.com/mobile/mobilefirst-for-ios/">IBM</a> project to digitally transform business processes at South Floridaâ€™s leading furniture chain, <a href="http://www.cityfurniture.com/">City Furniture</a>. I caught up with City Furniture CIO, Steve Wilder andÂ Rodney Bryant, IBM Global Business Services Retail Industry Lead for the Apple Partnership Team,Â to find out more.</p><h3><strong>iOS for the enterprise</strong></h3><p>This is another of the rapidly growing number of iOS in the enterprise stories. City Furniture has worked with Apple and IBM to deploy a three IBM MobileFirst for iOS apps: Sales Assist, Payment and Finance. The apps <a href="http://mobilebusinessinsights.com/2016/06/beyond-gaming-how-swift-is-hitting-the-reset-button-on-mobile-enterprise-development/">were built using the Swift language</a>. These new solutions are already proving their value, but Appleâ€™s contribution in their development was a big reason the furniture chain chose them.</p><p>Â â€œThe Cupertino Design Workshop made the decision [to build the apps] easy and was one of the deciding factors,â€ said Wilder.</p><p>â€œWe understood that IBM and Apple were the right path and the right partners after experiencing the Cupertino workshop. Â We were confident that Apple would bring the usability and easy to use device and that IBM would bring the enterprise and integration expertise to our existing systems.â€</p><aside class="nativo-promo smartphone" id=""> </aside><h3><strong>How do the apps make shopping better?</strong></h3><p>Todayâ€™s customers are <a href="http://www.computerworld.com/article/2893719/apple-watch-will-change-the-way-you-shop.html">much more clued-up</a>.Â </p><p>When making big purchases they have often done much of their research online, will often purchase the items online, and really just want to visit stores to see them in physical form.</p><p>"Todayâ€™s consumer is a savvy shopper, armed with more product knowledge than ever before," said Bryant. "The convergence of physical and digital in retail is driving customersâ€™ desire a convenient, personalized experience."</p><p>This means that across their visit, customers want to be able to access all the information they need as they need it, and donâ€™t want to spend valuable time in queues or walking between payment counters.</p><aside class="nativo-promo tablet desktop" id=""> </aside><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155339586434680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p>The iOS apps reduce this customer friction by making it possible for store staff to do almost any task from their iPad.Â </p><p>Staff can find products, create invoices and provide shoppers with huge amounts of detail about products much more quickly than before.</p><p>They can take payments on the spot using an iPad, arrange finance deals, and also get access to customer insights which enable them to make recommendations that are personalized to the needs of individual customers.</p><h3><strong>Advice for digital transformation projects</strong></h3><p>Wilder has some excellent advice for enterprises seeking to successfully engage in digital transformation projects of this kind. They can be seen as a Best Practise Model for any enterprise seeking to engage in the same:</p><ul> <li style="padding-left: 30px;"><em>Support from the Top</em>: Company management â€œshared a clear vision of the potential, expected improvements these mobile apps would provideâ€. This recognition meant the company â€œprioritized the completion of these Apps over many other queued up IT projects and without this level of support, it would have been difficult to remain focused and complete the Apps.:</li> <li style="padding-left: 30px;"><em>Commit, fully:</em>Â  Management understood that in order to make these changes work, it needed to â€œmake the mobile apps so appealing, compelling and rewardingâ€ that company staff would want to use them. â€œAdoption is critical to ensuring the sustainability of the mobile platform that City Furniture hopes to continuously improve upon in the future,â€ Wilder stressed.</li> <li style="padding-left: 30px;"><em>Teams matter:</em> The apps may be easy-to-use, capable and deceptively simple, but their development demanded a lot of coordinated effort and collaboration across the company. â€œInvolvement and contributions were made by external partners (IBM, Apple, INGENICO and others) and by internal resources across every City Furniture business unit,â€ Wilder told me. â€œThe Apps are the product of extraordinary planning, design, development, testing, implementation, monitoring and continuous improvement.â€</li> </ul><p>"Innovation is not a project; it is a new way of operating and behaving," says IBM''s Bryant. "Innovation requires the willingness to really focus on the user experience, experiment, to invest and embrace failing fast. Â Creating an agile organizational construct to foster, govern and manage an ongoing innovation process and capability is a foreign practice for most retailers. Â Yet when competing with the likes of dominate online pure plays, itâ€™s becoming critical to their business."</p><h3><strong>The measure of success</strong></h3><p>City Furniture has achieved success with its new approach. The company claims to have:</p><ul> <li>Grown the average purchase order per customer over five percent per customer</li> <li>Increased average in-home warranty service sales by over 18 percent</li> <li>Reduced the value of customer discounts by almost 60 percent</li> <li>Halved the time it takes for customers to choose, finesse, pay and arrange delivery for products</li> <li>Customers are able to order more accurately.</li> </ul><p>We will see more and more retailers embrace models like these.</p><p><a href="http://www.computerworld.com/article/3195347/apple-ios/this-little-app-shows-why-apple-s-retail-store-changes-make-complete-sense.html">Appleâ€™s own retail stores</a> are excellent examples of this new approach to connected shopping, with their focus on community engagement.</p><p>In more and more cases the future of retail is as community-facing showrooms where consumers can get hands on experience of products they may have originally found online, and wonâ€™t purchase until later.</p><p>"Stores are a great platform for customers to try out products, engage with retailerâ€™s best brand ambassadors--store associateâ€”as well as being a place to warehouse products and conduct transactions," Bryant told me.</p><p>At its simplest, retailers no longer provide buying opportunities, but buying experiences. Thereâ€™s an excellent explanation of this over here at <em><a href="http://www.retaildive.com/news/why-retailers-are-trying-on-showrooms/439990/">Retail Dive</a></em>.</p><p>In future, technologies such as Augmented and Virtual Reality and machine intelligence will also transform the retail sector. AR and VR will enable consumers to make better decisions about what to buy, but it''s possible the big change will be in AI.</p><p>"Cognitive computing, or AI, can turn vast amounts of data into: actionable insights to share throughout the entire enterprise, make predictive, personalized, hyperlocal recommendations to consumers, and engage directly with them to gain a competitive advantage," said Bryant.</p><p>I am in no doubt at all that we will see Apple introduce more technologies designed to help build on such achievements <a href="http://www.computerworld.com/article/3197752/apple-ios/wwdc-2017-10-predictions-for-enterprise-it.html">appear at WWDC 2017</a>.</p><p><strong>Google+?</strong>Â If you use social media and happen to be a Google+ user, why not joinÂ <a href="https://plus.google.com/u/0/communities/102592251674546201152">AppleHolic''s Kool Aid Corner community</a>Â and join the conversation as we pursue the spirit of the New Model Apple?</p><p><strong>Got a story?Â </strong><a href="https://twitter.com/jonnyevans_cw"><strong>Drop me a line via Twitter</strong></a>Â or in comments below and let me know. I''d like it if you chose to follow me on Twitter so I can let you know when fresh items are published here first on Computerworld.</p> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:23', 1, 'Admin'),
(147, 'Connecting with work from the road? Here&#039;s how to stay safe', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>Every company has workaholics who canâ€™t leave their duties behind when heading out on vacation.Â They''re kind of worker who, if the hotel doesnâ€™t have Wi-Fi, will rush to the closest coffee shop or eatery to stay connected, check email and jump onto a video conference call.</p><p>Those are the kinds of insecure wireless networks that make IT security managers nervous.Â </p><p>And for good reason. Public Wi-Fi networksÂ at cafes and coffee shops are open to, and can be accessed by, anyone, according to mobile security vendor iPass. They require neither security keys and passphrases nor firewall protection. That leaves Â employees vulnerable toÂ <a href="http://csoonline.com/article/3089946/mobile-security/examining-man-in-the-middle-attacks.html" target="_blank">man-in-the-middle</a> attacks.</p><p>When an attacker intercepts communications, it''s possible to snoop on traffic as it goes from user to server. Gather enough info and it''s easy for the attacker to then pose as a trusted user and gain access to sensitive corporate data. Companies that deal with personal and financial data are at greater risk of such attacks.</p><aside class="nativo-promo smartphone" id=""> </aside><aside class="fakesidebar"><strong>[ Free download: <a href="http://www.computerworld.com/resources/110225/mobile-wireless/mobile-management-vendors-compared#tk.ctw-infsb">Mobile management vendors compared</a> ]</strong></aside><p>Man-in-the-middle attacks are a big concern because they''re easy to pull off, said RaghuÂ Konka, vice president of engineering at iPass. â€œAt public Wi-Fi locations, the airwaves are open and any attacker with a simple antenna can mount an attack,â€ he said.</p><p>To improve overall online security:</p><ul> <li>When connecting to a public Wi-Fi network, make sure you browse secured sites only.</li> <li>Use a VPN. This will protect traffic where it is most vulnerable, the last mile between a user and a server.</li> <li>Enterprises should educate workers on vulnerabilities and provide the tools needed to combat them.</li> <li>Keep your devices up-to-date with latest software.</li> <li>Be cautious about opening or replying to emails from unknown senders.</li> </ul><figure class="large"><img src="http://images.techhive.com/images/article/2017/05/mobile-risk-100723371-large.jpg" border="0" alt="mobile risk" width="700" height="429" data-imageid="100723371"/> <small class="credit">iPass</small></figure><p>IPass, which surveyed 500 CIOs and senior IT decision makers from the U.S., U.K., Germany and France, found that organizations consider C-level employees, including the CEO, to be at the greatest risk of being hacked; coffee shops are regarded as the most dangerous public Wi-Fi venue; organizations are increasingly concerned about growing mobile security risks; and man-in-the-middle attacks are deemed the greatest threat.</p><p>In the survey, 78% of respondents chose coffee shops as one of their top three most popular locations for accessing work. Airports were next followed by exhibition centers.</p><aside class="nativo-promo tablet desktop" id=""> </aside><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155338142499680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p>IPass said companies hoping to mitigate security risks have been moving to ban the use of public Wi-Fi hotspots. Sixty-eight percent of those surveyed ban the use Wi-Fi hotspots; 31% ban their use at all times (up from 22% in 2016), and 37% ban their use sometime. On top of that, 14% plan to roll out a ban on public Wi-Fi hotspots in coming months. That number is down from 20% last year, suggesting that many organizations introduced a ban in the last 12 months, according to iPass.</p><p>But those kinds of edicts could be a detriment to business goals. Most electronic devices shipped worldwide are Wi-Fi only, so blocking connectivity to hotspots at coffee shops, hotels, airports and in flight could mean workers aren''t able to get things done while on the go.</p><p>Public Wi-Fi networks aren''t the only things that attract thieves. So do the smartphones and tablets themselves, said Domingo Guerra, co-founder and president ofÂ <a href="https://www.appthority.com/">Appthority</a>. So it''s important to make sure you can do a remote wipe, should a device be lost or stolen, to protect data. It''s also good toÂ have backups of your device and data before heading out, use a strong passcode on the lock screen and disable any touch-ID unlock feature.Â Increasingly, governments are asking travelers to temporarily hand over phones, and itâ€™s harder to compel someone to share their password then it is to use their fingerprint, Guerra said.</p><aside class="fakesidebar"><strong>[ Further reading: <a href="http://www.computerworld.com/article/3150992/wireless-carriers/the-votes-are-in-which-mobile-data-provider-is-best.html#tk.ctw-infsb">The votes are in: Which mobile data provider is best?</a> ]</strong></aside><h4><strong>Watch out for certain apps</strong></h4><p>Guerra recommends travelers stick with official app stores, such as the those from Google and Apple. Some tourist destinations offer custom or private apps not distributed through the official stores. â€œItâ€™s important to avoid side loaded apps at all times,â€ he said.</p><p>Another concern: permission requests from the apps you download.</p><p>â€œIf you donâ€™t understand why the app is asking to access your photos or contacts, for example, decline access. The app can ask you again when it needs that permission and that will give you more information about whether you want to share access or not. It is common to see apps request more data or permissions than necessary,â€ Guerra said.Â </p><p>When on the road, some permissions become riskier. For example, apps that are accessing, then sharing/broadcasting your location at all times (â€œAlways onâ€) can be more dangerous while traveling in foreign countries. Try to grant the minimum number and level of permissions. Most of the time, the app will work fine without the extra data -- data that is often sold to third parties to profile you.</p><p>Finally, while Apple and Google review apps for malware, they don''t look for security best practices like properly encrypting sensitive data or protecting back ends and databases, he said.</p><p>App traffic is often not properly secured or encrypted, Guerra said.Â â€œThis makes it crucial to avoid free/public Wi-Fi hotspots such as hotels and coffee shops when performing sensitive transactions from your mobile device, such as banking, shopping, or working on company sensitive information.â€Â </p><p>That''s why it''s prudent, he said, to invest in a mobile VPN and/or purchase a roaming data plan for international travel.</p><figure class="large"> <div class="embed-wrapper"> <div class="embed-container"><video id="vid76195" controls="controls" class="embeddedVideo" poster="https://cms-images.idgesg.net/images/article/2017/03/template-c100.00_15_12_03.still001-100715706-poster.jpg" width="562" height="326"> </video></div> </div> </figure> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:23', 0, 'Admin'),
(148, 'No, Windows XP didn&#039;t fuel WannaCry', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>The global WannaCry attack that started 10 days ago touched just a handful of Windows XP PCs, a security expert said Monday, contradicting the narrative that the aged OS was largely responsible for the ransomware''s crippling impact.</p><p>"There were no real WannaCry infections of Windows XP," said Costin Raiu, director of Kaspersky Lab''s global research and analysis team, in an interview Monday. "We''ve seen only a handful of cases, less than a dozen, and it looks like most of them were testers [self-infecting systems]."</p><aside class="fakesidebar"><strong>[ Further reading: <a href="http://www.computerworld.com/article/3147819/security/fighting-ransomware-a-fresh-look-at-windows-server-approaches.html#tk.ctw-infsb">Fighting ransomware: A fresh look at Windows Server approaches</a> ]</strong></aside><p>Raiu''s claim countered an assertion made by virtually every media report and blog post published after "WannaCry" emerged June 12. Countless news stories blamed Windows XP, which Microsoft retired three years ago, for falling victim to the attack because the vulnerability that WannaCry exploited had not been patched in the obsolete OS.</p><p>Rather than take aim at Windows XP, WannaCry targeted Windows 7 and Windows Server 2008, Kaspersky''s data showed. The vast majority -- 98.4% -- had put the crosshairs on Windows 7, which remains the world''s most popular edition. To come up with that figure, Kaspersky tallied the WannaCry detections its security software logged -- and blocked -- on various versions of Microsoft''s operating system.</p><aside class="nativo-promo smartphone" id=""> </aside><p>The reason for XP''s absence from the WannaCry count was simple. "WannaCry itself did not support Windows XP," Raui said, noting that the exploit neither focused on XP or reliably worked on the 2001 operating system. Individual machines could be infected -- the researchers and testers who put WannaCry on Windows XP systems likely ran it manually -- but the worm-like attack code would not spread from an XP PC, and in some cases, executing the exploit crashed the computer.</p><p>That put Microsoft''s decision to issue a security patch for Windows XP in a different light.</p><p>Late on May 12, <a href="http://www.computerworld.com/article/3196292/windows-pcs/microsoft-issues-first-windows-xp-patch-in-3-years-to-stymie-wannacrypt.html">Microsoft took the unprecedented step of issuing patches</a> for long-demoted versions of Windows, including Windows XP, to immunize PCs against WannaCry. "Given the potential impact to customers and their businesses, we made the decision to make the Security Update for platforms [currently] in custom support," a Microsoft manager said at the time. Custom support is a post-retirement <a href="http://www.computerworld.com/article/2488354/microsoft-windows/microsoft-slashes-windows-xp-custom-support-prices-just-days-before-axing-public-p.html">pay-for-patches program</a> available only to corporate customers.</p><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155337426774680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p><i>Computerworld</i>, like many other publications, assumed Microsoft released patches for Windows XP and Server 2003 because it believed older -- and unprotected -- systems were instrumental in spreading WannaCry.</p><aside class="nativo-promo tablet desktop" id=""> </aside><p>Raiu thought different. "I think Microsoft was worried about the <i>possibility</i> of someone leveraging this exploit," Raiu argued. "Their fear was that it could be theoretically possible to repurpose the exploit to attack Windows XP."</p><p>It wasn''t a surprise that WannaCry''s backers had primarily pointed the attack at Windows 7. "They focused on the most-widespread platform," said Raiu.</p><p>According to analytics vendor Net Applications, approximately 53% of all Windows personal computer ran Windows 7 last month. That was nearly double the share of the newer Windows 10, which clocked in at 29%, and more than eight times that of Windows XP''s 8%. Cyber criminals typically aim attacks at the most popular operating systems and versions within each OS, a logical practice when profit is paramount. That''s especially true of extortion rackets like WannaCry''s payload, which encrypts files and then demands a ransom payment to decrypt those hijacked files.</p><p>Other factors may have played a part, however. "The newer Windows versions, like Windows 8.1 and Windows 10, include new security mitigations, which may have made it easier for them to [write an] exploit for Windows 7," Rauf said.</p><p>When it issued security fixes to Windows XP, Microsoft said that Windows 10 systems "were not targeted" by WannaCry.</p><p>Of the Windows 7 systems that were attacked -- but defended by Kaspersky''s software -- most were 64-bit editions. Windows 7 Pro and Windows 7 Home (64-bit) outnumbered their 32-bit comrades by almost two to one. Windows 7 Pro 64-bit led all others, accounting for 60% of the total.</p><p>It was unclear whether the disparity reflected Kaspersky security software placement -- in, say, far more PCs running the 64-bit version of Windows -- the prevalence of 64-bit over 32-bit at this point, or a more efficient spreading mechanism of WannaCry under a 64-bit OS. With the data illustrating detection and stoppage rates -- not infection rates as some other reports cited -- it was plain, however, that the difference could not have stemmed from faster deployment of the March patches by 32-bit owners.</p><figure class="large"><img src="http://images.techhive.com/images/article/2017/05/damyyygwaaadad9-100723439-large.jpg" border="0" alt="damyyygwaaadad9" width="700" height="407" data-imageid="100723439"/> <small class="credit">Kaspersky Lab</small> <figcaption> <p>Missing from Kaspersky''s chart was Windows XP, which was simply not on WannaCry''s radar.Â </p> </figcaption></figure> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:24', 1, 'Admin');
