(149, 'Leak: Secret Facebook rules on what violence, self-harm and child abuse can be posted', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>Facebook allows users to livestream self-harm, post videos of violent deaths and photos of non-sexual child abuse, but comments which threaten to harm President Donald Trump are to be deleted, according to Facebookâ€™s secret rule books for monitoring what its 2 billion users can post.</p><p><a href="https://www.theguardian.com/news/2017/may/21/revealed-facebook-internal-rulebook-sex-terrorism-violence" target="_blank">The Guardian</a> got hold of leaked copies of over 100 internal Facebook manuals and documents that tell moderators how to handle content which includes violence, sex, hate speech, terrorism, nudity, self-harm, revenge porn and more controversial content â€“ even cannibalism.</p><p>The giant social network has increasingly come under fire for how it handles disturbing content and for depending too heavily on users to report such content. At the beginning of May, Facebook CEO Mark Zuckerberg <a href="https://www.facebook.com/zuck/posts/10103695315624661" target="_blank">announced</a>Â the company would hire 3,000 more people â€“ on top of the 4,500 moderators it had â€“ â€œto review the millions of reports we get every week.â€</p><p>The leaked internal guidelines were given to Facebook moderators â€œwithin the last year,â€ the Guardian said. The documents show the fine line Facebook teeters on when deciding what content to censor without being accused of squashing free speech.</p><aside class="nativo-promo smartphone" id=""> </aside><p>10 secondsâ€¦thatâ€™s about how long Facebook moderators have to decide if content should be removed, according to the Guardian. The internal manuals for moderators give examples of what to censor when it comes to <a href="https://www.theguardian.com/news/gallery/2017/may/21/facebooks-internal-guidance-on-showing-graphic-violence" target="_blank">graphic violence</a>, <a href="https://www.theguardian.com/news/gallery/2017/may/21/facebook-rules-on-showing-cruelty-to-animals" target="_blank">animal abuse</a>, <a href="https://www.theguardian.com/news/gallery/2017/may/21/facebooks-manual-on-credible-threats-of-violence" target="_blank">credible threats of violence</a>, <a href="https://www.theguardian.com/news/gallery/2017/may/21/facebooks-internal-manual-on-non-sexual-child-abuse-content" target="_blank">non-sexual child abuse</a> and more.</p><p><strong>Credible threats of violence</strong></p><p>Leaked documents show that the following call for violent action is allowed: â€œTo snap a b*tchâ€™s neck, make sure to apply all your pressure to the middle of her throat.â€ But commenting â€œSomeone shoot Trumpâ€ is not and should be deleted since he is a head of state.</p><p><strong>Self-harm </strong></p><aside class="nativo-promo tablet desktop" id=""> </aside><p>Facebook, which purportedly has received <a href="https://www.theguardian.com/news/2017/may/21/facebook-users-livestream-self-harm-leaked-documents" target="_blank">over 5,000 reports</a> of potential self-harm in a two-week period, says it is OK for users to livestream attempts to self-harm. According to an internal policy update, moderators were told: â€œWeâ€™re now seeing more video content â€“ including suicides â€“ shared on Facebook. We donâ€™t want to censor or punish people in distress who are attempting suicide.â€</p><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155336192349680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p>However, Facebook will try to get other agencies to do a â€œwelfare checkâ€ when a person is attempting suicide. Once there is no chance of helping that person anymore, the video is removed.</p><p><strong>Graphic violence</strong></p><p>Videos of violent deaths help create awareness, Facebook believes. The footage should be marked as disturbing and â€œhidden from minors,â€ but not automatically deleted since the videos can â€œbe valuable in creating awareness for self-harm afflictions and mental illness or war crimes and other important issues.â€</p><p>Images of animal abuse are allowed for awareness purposes, but â€œextremely disturbingâ€ photos of animal mutilations and videos of torturing animals are to be marked as disturbing. If the violence against animals is sadistic or celebratory, then it is not allowed and is deleted.</p><p><strong>Child abuse</strong></p><p>Facebook allows videos of child abuse to be posted, as long as it is non-sexual and marked as â€œdisturbing.â€ Videos or photos of child abuse which are shared with sadism and celebration are removed. Imagery of child abuse is allowed unless the child is naked.</p><p><strong>Nudity</strong></p><p>Nudity is allowed if it is a â€œnewsworthy exceptionsâ€ or if it is â€œhandmade art.â€ Digitally created art showing sexual activity as well as revenge porn are not allowed. Facebook also allows videos of abortions as long as there is no nudity in the footage.</p><p>Facebook wonâ€™t confirm if the documents obtained by the Guardian are authentic, but Facebook released the following statement:</p><blockquote> <p>Keeping people on Facebook safe is the most important thing we do. In addition to investing in more people, weâ€™re also building better tools to keep our community safe. Weâ€™re going to make it simpler to report problems to us, faster for our reviewers to determine which posts violate our standards and easier for them to contact law enforcement if someone needs help.</p> </blockquote> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:24', 0, 'Admin'),
(150, 'WWDC 2017: 10+ predictions for enterprise IT', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>There is little argument that Appleâ€™s solutions have <a href="http://www.computerworld.com/article/3197626/apple-ios/15-reasons-apple-leads-the-mobile-enterprise.html">entered the cutting edge of enterprise IT</a>, empowering digital transformation across <a href="http://www.computerworld.com/article/3177371/apple-mac/apple-s-enterprise-success-mac-and-ios-usage-is-climbing-fast.html">some of the worldâ€™s biggest companies</a>. With this in mind I thought it might be interesting to put together just a few details concerning Appleâ€™s enterprise-focused improvements you can expect to see revealed at the companyâ€™s <a href="http://www.computerworld.com/article/3186420/apple-mac/12-reasons-you-ll-want-to-be-at-wwdc-2017.html">Worldwide Developerâ€™s Conference next month</a>.</p><h3><strong>A new iPad Pro</strong></h3><p>We think it probable Apple <a href="http://www.applemust.com/please-dont-kill-the-ipad-mini-make-it-pro-instead/">will introduce</a> a new 10.5-inch iPad Pro 2 at WWDC, with <em><a href="http://www.digitimes.com/news/a20170519PD205.html">Digitimes</a></em> hesitantly suggesting a new model of the existing 12.9-inch iPad Pro 2 wonâ€™t ship until the third quarter. Equipped with a smaller bezel for a larger usable screen<a href="http://www.computerworld.com/article/3184220/apple-ios/6-things-you-need-to-know-about-apples-a11-iphone-processor.html">, significantly faster processor</a> and exciting usability improvements, Apple will be hoping to both blow the Surface underwater and regain its hold of the lucrative enterprise mobility markets. The question is <a href="http://www.computerworld.com/article/3176508/apple-mac/apple-needs-to-go-pro-for-the-ipad-pro.html">how pro can Apple go</a>?</p><h3><strong>Apple Watch Series 3</strong></h3><p>Iâ€™m a little less certain what to expect here. However, recent claims Appleâ€™s Tim Cook has been testing a non-invasive <a href="http://www.computerworld.com/article/3189774/apple-ios/422-million-reasons-apple-is-building-diabetes-sensors.html">diabetes sensor</a> around Apple campus is a big enough reveal it leads me to expect some news on this at WWDC. Introduction of non-invasive diabetes sensors along with an expected host of <a href="http://www.computerworld.com/cms/article/other%20health-related%20improvements">other health-related improvements</a> will have <a href="http://www.computerworld.com/article/3196714/apple-ios/7-ways-apple-watch-is-already-in-the-enterprise.html">consequences across multiple industries</a>, from health insurance to employee wellness programs. The new model is unlikely to ship until Q4.</p><h3><strong>64-bit power</strong></h3><p>iOS 11 will be a true 64-bit operating system. This is likely to have consequences on enterprises standardized around proprietary 32-bit apps, (these will need to be upgraded). The OS will also use the new APFS filing system now supported across current implementations of iOS 10. The nature of these changes should be high performance, power efficiency and much improved data security.</p><aside class="nativo-promo smartphone" id=""> </aside><h3><strong>Augmented reality (AR)</strong></h3><p>We donâ€™t really know how far along Apple is with AR development, but the companyâ€™s <a href="http://www.computerworld.com/article/3182715/apple-ios/apple-s-reality-distortion-field-coming-to-an-iphone-near-you.html">willingness to discuss</a> it along with current industry trend suggests it will at least reveal <a href="http://www.computerworld.com/article/3170873/apple-ios/why-a-wwdc-2017-reveal-for-iphone-8-is-possible.html">some of the details</a> of how it plans to create an AR program for developers. While the company is likely to stress consumer use scenarios for AR when it does, there will be huge implications across multiple enterprises. There are already active examples in which enterprises involved in retail, agriculture, energy exploration, distribution, product design and many other fields are using AR in their work. It really is a big deal: Gartner research VP, Brian Blau predicts that by 2019: â€œAR, VR and mixed reality (MR) solutions will be evaluated and adopted in 20% of large-enterprise businesses,â€ forming a $143.3 billion market by 2020.</p><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155335196349680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><h3><strong>iPhone 8Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  </strong></h3><p>Likely the most advanced mobile device the world has ever seen, Apple will be hoping its new highest-end smartphone will follow in the footsteps of previous iPhones and the iPad in capturing the hearts and minds of C-suite executives once again. When it does, the device may generate an upgrade cycle that <a href="http://www.applemust.com/canaccord-genuity-raises-aapl-target-cites-strong-iphone-8-demand/">exceeds previous iPhone introductions</a>. C-status execs will justify their investment on the basis of exploring the potential of Apple AR. Apple won''t talk about the product at the show, but it will be interesting to see if it has any advice for developers to help them create next-generation AR solutions.</p><h3><strong>Swift 4.0</strong></h3><p>Appleâ€™s open source <a href="https://developer.apple.com/videos/play/enterprise/402/">Swift programming language</a> has won lots of praise across the developer community. It regularly sits among the <a href="http://www.tiobe.com/tiobe-index/programming-languages-definition/">top ten programming languages</a> and has attracted support across platforms and the developer community. IBM, for example, makes extensive use of Swift. <a href="http://www.computerworld.com/article/3122994/apple-mac/ibm-says-swift-is-now-ready-for-the-enterprise.html">Speaking just last year</a>, Mike Gilfix, IBMâ€™s VP ofÂ <a href="http://www.ibm.com/mobilefirst/us/en/mobilefirst-for-ios/">MobileFirst</a>Â and Smarter Process <a href="http://www.computerworld.com/article/3122994/apple-mac/ibm-says-swift-is-now-ready-for-the-enterprise.html">told me</a>: â€œWith this release, Swift is now ready for the enterprise,â€ Gilfix says. â€œI used to be a language hacker back in the dayâ€¦. Itâ€™s not every day you see the birth of a new programming ecosystem like Swift is going to be. I think weâ€™re only getting started.â€ WWDC 2017 will see further improvements to the increasingly essential language, and this should interest most in enterprise IT.</p><h3><strong>New Macs</strong></h3><p>Users at the highest end of the Apple spectrum remain disappointed that the company <a href="http://www.computerworld.com/article/3187402/apple-mac/apple-upgrades-mac-pro-says-sorry-to-pro-users.html">dropped the ball with Mac Pro</a>, but Apple will attempt to tide them over with improved MacBook, MacBook Air and MacBook Pro models, equipped with <a href="http://www.computerworld.com/article/3197225/apple-mac/wwdc-apples-kaby-lake-macbook-upgrades-coming-soon.html">Kaby Lake processors</a>. Speculation claims these will appear at or around WWDC. Apple will also discuss the latest iteration of macOS at the event, this is likely to introduce machine intelligence across wider feature sets and a more context-aware Siri.</p><aside class="nativo-promo tablet desktop" id=""> </aside><h3><strong>Siri and AI</strong></h3><p>â€œWe are actively working cognitive into our portfolio to include a number of Watson capabilities that will take our apps to the next level,â€ IBMâ€™s Heidi Fillmore, Executive Partners, Travel &amp; Transportation Apple + IBM Product Lead <a href="http://www.computerworld.com/article/3166613/apple-ios/expect-more-a-i-in-apples-ios-enterprise-future.html">told me earlier this year</a>. â€œThese include natural language capabilities, richer personalization insights, deeper business insights all based on cognitive so our apps just get smarter over time as the system learns.â€ There is little doubt that increased context-awareness in Siri will have implications for enterprise IT, just how much impact this might have hangs on how extensive this yearâ€™s improvements turn out to be.</p><h3><strong>Services</strong></h3><p>Apple is likely to spend a little time talking about its Messages platform. It will extend this with new APIâ€™s to widen the number of apps supported on the platform, which will work with Siri in order to enable users to access some tools from a wearable device (eg: Tap the AirPod to summon a taxi or make a payment). Apple Pay will get some focus â€“ it deserves too as the teams behind the service have <a href="http://www.applemust.com/apple-pay-is-closing-in-on-paypal/">worked incredibly hard</a>. There is speculation this will include the ability to pay people using a Message, which may have implications in customer service and retail opportunities.</p><h3><strong>Maps</strong></h3><p>Recent intensification of <a href="http://www.applemust.com/what-are-apple-maps-cars-doing/">Apple Maps car sightings</a> suggests the company may be ready to make some key announcements around its mapping platform as it seeks to dispel the negativity associated with its service following its <a href="http://www.computerworld.com/article/2473547/apple-ios/ios-chief-scott-forstall-out---jony-ive-to-lead-future-apple-user-interface-design.html">botched launch</a>. I imagine these will tie in well with new <a href="http://www.lanews.org/ibeacon-and-bluetooth-beacon-market-forecast-by-end-use-industry-2016-2026/">iBeacons features</a>, as the company seeks to build an infrastructure to support AR in everyday life. Such introductions will have big implications for retailers and their IT solutions.</p><h3><strong>Warning</strong></h3><p>WWDC is one of the key events for speculation regarding Appleâ€™s plans. While some or all of these announcements may be made there is no guarantee the information will be disclosed within the presently predicted time frame.</p><p><strong>Google+?</strong>Â If you use social media and happen to be a Google+ user, why not joinÂ <a href="https://plus.google.com/u/0/communities/102592251674546201152">AppleHolic''s Kool Aid Corner community</a>Â and join the conversation as we pursue the spirit of the New Model Apple?</p><p><strong>Got a story?Â </strong><a href="https://twitter.com/jonnyevans_cw"><strong>Drop me a line via Twitter</strong></a>Â or in comments below and let me know. I''d like it if you chose to follow me on Twitter so I can let you know when fresh items are published here first on Computerworld.</p> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:24', 3, 'Admin'),
(151, 'For enterprise protection, antivirus software is no longer enough', '<div id="drr-container" class="is-insider" itemprop="articleBody"> <p>Antivirus software to protect corporate systems from malware is like a flu shot. You should have it, but it won''t likely protect you from every strain of the flu.</p><p>"Antivirus is great for blocking known threats, but the issue has grown past viruses," said Ryan Oâ€™Leary, vice president of the Threat Research Center at WhiteHat Security. "Malware and vulnerabilities in the network or application can lead to far greater compromise."</p><p>Worse yet, new threats are being crafted faster than traditional antivirus can keep up.</p><p>â€œWe as an industry need to recognize that defaulting to an antivirus and firewall mentality is leaving yourself wide open to compromise," Oâ€™Leary said. "Companies need to take a more holistic approach to their security program and start looking at application, network and malware issues that could compromise their entire company.â€Â </p> <div class="empty-div"></div> <div class="tease-promo"> <p class="tease-title">To continue reading this article register now</p> <div class="access-btn"><a class="btn register" href="javascript://" onclick="IDG.insiderReg.registerLinkEvent(''insider-reg-form-short'')" data-modal-id="insider-popup">Get Free Access</a></div> <p class="tease-links"> <a href="/learn-about-insider/">Learn More</a> &nbsp; Existing Users <a href="javascript://" onclick="IDG.insiderReg.registerLinkEvent(''insider-reg-signin'')" data-modal-id="insider-popup">Sign In</a> </p> </div> <script>$(document).ready(function($){$(function(){$(".signin-register > a.signin, .signin-register > a.register").click(function(){$(".signin-register > a.signin, .signin-register > a.register").removeClass("selected");$(this).addClass("selected");return false;});});if(typeof(IDG.insiderReg.readCookie(''nsdr''))==''undefined''&&$thm.deviceWidthAtLeast($thm.deviceBreakpoints.tablet)){$triggered_times=0;$(window).on(''scroll'',function(){if($(''.signin-register > a'').hasClass(''selected'')){$triggered_times=1;}var y_scroll_pos=window.pageYOffset;var emptyDiv=$(''.empty-div'').offset().top;var scroll_pos_test=emptyDiv-600;if(y_scroll_pos>scroll_pos_test&&$triggered_times==0){$triggered_times=1;IDG.insiderReg.registerLinkEvent(''insider-reg-form-short'');$(''body'').append("<div class=''modal-overlay modal-close''></div>");$(''.modal-overlay'').fadeTo(500,0.9);$(''.modal-overlay'').height($(document).height());$(''#insider-popup.modal-box'').fadeIn(500);if(navigator.userAgent.match(/(iPad)/)){$("html, body").animate({scrollTop:0},500);}}});}});</script> </div>', '2017-05-25 23:21:25', 1, 'Admin'),
(152, 'The ransomware epidemic: How to prep for a shakedown', '', '2017-05-25 23:21:25', 0, 'Admin'),
(153, 'Microsoft does enterprise no favors when it won&#039;t explain Windows 10&#039;s schedule', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>Microsoft has failed to explain to corporate customers the repercussions of the twice-a-year schedule that will deliver Windows 10 upgrades each March and September, an analyst argued today.</p><p>There are too many uncertainties about the upgrade schedule, a critical part of Microsoft''s "Windows as a service" model, said Michael Cherry, analyst with Directions on Microsoft.</p><aside class="fakesidebar"><strong>[ Related: <a href="http://www.computerworld.com/article/3155816/microsoft-windows/fix-windows-10-problems-with-these-free-microsoft-tools.html#tk.ctw-infsb">Fix Windows 10 problems with these free Microsoft tools</a> ]</strong></aside><p>"Customers shouldn''t have to figure this out," Cherry said, referring to unanswered questions he had after participating in an online "Ask Me Anything"-style discussion that Microsoft hosted two weeks ago. "We shouldn''t even be having this conversation about, ''Maybe they mean this, or maybe they mean that.'' They should have told us, ''Here''s how it works, here''s the documentation, here''s the TechNet article, here''s everything.''"</p><p>Cherry aimed his criticism at <a href="http://www.computerworld.com/article/3191510/microsoft-windows/microsoft-fixes-windows-10-upgrade-tempo-and-timing-to-placate-enterprises.html">Microsoft''s announcement last month</a> that Windows 10 feature upgrades would release each March and September, and that each upgrade would be supported for 18 months.</p><aside class="nativo-promo smartphone" id=""> </aside><p>His first complaint was that Microsoft presented the new setup as a done deal that customers -- including enterprises that want consistency -- could bank on. But the company has not yet demonstrated it can hit an every-six-month schedule; the three upgrades released thus far came at intervals of 4 months, 7 months and 11 months.</p><p>Cherry questioned the company''s ability to fulfill its promise. "We need to see consistency that they''re able to accomplish this," he cautioned. "For now I say that this is aspirational, not policy. They hope to do this [every March and September]. But if they don''t, they don''t. If it''s June, it''s June. Or April."</p><p>The problem is that if Microsoft <i>doesn''t</i> make a deadline, the delay would have a domino effect. "What happens if they slip too far?" Cherry asked. "If Microsoft misses [a release] by six months, then they''ve knocked six months off the time before you have to upgrade to the next."</p><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155325288159680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p>Microsoft has said nothing about what it would do in such a case. And that''s a problem, said Cherry. If Microsoft pushes back the following releases, for example, the March-and-September cadence collapses. But if Microsoft simply resumes the tempo with the next slated release, the delay either eats into a version''s support lifetime or throws off the schedule.</p><aside class="nativo-promo tablet desktop" id=""> </aside><p>One likely consequence? Microsoft''s promise that customers will be able to skip a Windows 10 features upgrade may be in deep trouble.</p><p>Under ideal conditions, enterprises have only a <a href="http://www.computerworld.com/article/3192990/microsoft-windows/faq-how-to-skip-a-windows-10-upgrade.html">two-month migration window</a> if they pass an intervening upgrade. Any delay in the schedule would make upgrade skipping impossible, forcing businesses to deal with each refresh, something Cherry predicted would happen.</p><p>In fact, businesses don''t really get a full 18 months out of any one Windows 10 version. The first four of the 18 is, and will continue to be, designated as relatively unpolished, fit for consumers -- who act as Microsoft''s unpaid testers -- but not for corporate use. Only after Microsoft promotes the version as suitable for widespread company deployment by marking it as "Current Branch for Business," or <a href="http://www.computerworld.com/article/3194738/microsoft-windows/microsoft-plots-changes-to-windows-10s-release-lingo.html">starting this fall, as "Semi-Annual Channel (Broad),"</a> are enterprises to roll it out to workers. So the maximum amount of support to businesses for a given version: 14 months.</p><p>Even companies that jump on the uneven code -- what Microsoft now calls "Current Branch" but will rename "Semi-Annual Channel (Pilot) in September -- may not get 18 months on a release.</p><p>"Microsoft told us, ''Don''t install it yet,''" Cherry said of version 1703, the feature upgrade that launched April 11. He was referring to Microsoft''s message, actually aimed at consumers, that they wait for Microsoft to offer the refresh rather than grabbing it immediately. Microsoft delivers feature upgrades in stages, first to a small set of users whose systems will have the greatest chance of successfully completing the upgrade. The company expands the upgrade pool as it fixes problems reported by others until it opens the throttle.</p><p>Last year it took three months to ship 2016''s one upgrade to more than 80% of those running Windows 10, meaning that many had 15 or fewer months of support.</p><p>"The 18-month count-down starts on the first day," Cherry said about an upgrade''s release. "But if you''re not at the front of the testing line, you don''t get 18 months. So should I speed up my timeline to get [the full] 18?"</p><p>If Microsoft promises that support lifecycle, Cherry argued, enterprise users should get it. "The clock really shouldn''t start until [a version] is fully deployable without concerns," he said. That would be when Microsoft reported a build as business ready, and promoted it to the Current Branch for Business, or when that label wears out, Semi-Annual Channel (Broad).</p><p>Under that alternate scheme, Windows 10 upgrades would be supported for a total of 22 months, not 18, as each refresh would still require some testing, presumably the same four months as today, with consumers before it''s rated ready for enterprise deployment. Such a change may seem minor, but it would mean -- assuming Microsoft continues to issue feature upgrades at six-month intervals -- that the firm would be required to support not two, but three CBB/Semi-Annual Channel (Broad) releases simultaneously, and for a four-month span when the latest was in consumers'' hands, <i>four</i> releases.</p><p>To know when support lapses for each given Windows 10 release, enterprises must construct visual aids, Cherry argued. "You have to actually figure out your support," he complained. "You almost have to build a matrix."</p><p>Microsoft has provided nothing like that. Previously, that was understandable because Windows 10 releases were on a more flexible schedule. But under the twice-yearly plan, releases and support are supposed to be consistent so that enterprises can plan; some kind of chart should have been forthcoming from Microsoft.</p><p>"It''s frustrating," concluded Cherry, speaking of Microsoft''s silence on scheduling topics. "Our clients come to us for answers, and we don''t have them."</p><figure class="large"><img src="http://images.techhive.com/images/article/2017/05/22-months-support-windows-10-100723300-large.jpg" border="0" alt="22 months support windows 10" width="700" height="253" data-imageid="100723300"/> <small class="credit">Computerworld/Gregg Keizer</small> <figcaption> <p>If Microsoft extended Windows 10 support to 18 months for corporate customers, as one analyst recommended, it would have to maintain three releases simultaneously, one more than it has pledged to do.</p> </figcaption></figure> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:26', 2, 'Admin'),
(154, '15 reasons Apple leads the mobile enterprise ', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>Apple Chief Financial Officer, Luca Maestri, set tongues wagging when he claimed the company had just set a â€œnew enterprise revenue recordâ€, though he didnâ€™t say why. I thought Iâ€™d try to explain it for him.</p><h3><strong>BYO Apple</strong></h3><p>Digital transformation is the dominant story of today â€“ not just in IT, but everywhere else as well. History will show that almost every part of life was impacted by mobile technology, and Appleâ€™s guaranteed place in <a href="http://www.applemust.com/apple-the-future-of-enterprise-it/">tomorrowâ€™s enterprise</a> is just one component of this.</p><p>The iPhone spawned the Bring Your Own Device (BYOD) revolution, one which itself spawned empowered workforces demanding choice: Choice in platform, choice in software, choice in working hours.</p><p>Flexibility is everything â€“ and itâ€™s generating some weird ironies: retailers donâ€™t run shops any more, they manage â€œexperiencesâ€; customer service is escaping from the call center to develop authentic voices in a sea of bots; conferences are as likely to be virtual as real.</p><aside class="nativo-promo smartphone" id=""> </aside><p>Even agricultural production is managed remotely using smartphones.</p><p>There are iPads in our homes, offices, airplanes and <a href="http://www.applemust.com/nasa-says-ipads-can-help-keep-astronauts-healthy/">above the sky</a>. Weâ€™re connected, and, when it comes to the enterprise, Apple has become synonymous with mobile tech.</p><h3><strong>Mobile everything</strong></h3><p>â€œBusinesses everywhere are becoming digital, software driven, and we believe ultimately - mobile centric.Â And it''s not just consumer services. It''s every industry and vertical on the planet,â€ Rowan Trollope, Ciscoâ€™s SVP GM of IoT and Applications GroupÂ <a href="http://www.computerworld.com/article/3120089/apple-ios/interview-cisco-says-apple-world-s-most-innovative-mobile-tech.html">told me last year</a>.</p><p>â€œApple offers the most innovative mobile technology in the world combined with the worldâ€™s most advanced mobile OS,â€ he also said.</p><aside class="nativo-promo tablet desktop" id=""> </aside><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155325513609680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p>According to <a href="https://www1.good.com/about/press-releases/mobility-index-report-shows-160-percent-increase.html">Good Technology''s Mobility Index Report</a>, iPhone accounted for 72% of all enterprise smartphone activations during the first quarter while iPad accounted for 81 percent of tablet activations.</p><p>The <a href="http://www.computerworld.com/article/3177371/apple-mac/apple-s-enterprise-success-mac-and-ios-usage-is-climbing-fast.html">JAMF annual survey</a> reveals similar sets of statistics, with 91 percent of organizations are now using Mac and 99 percent on iPad and iPhone.</p><p>"All our products continue to be extremely popular and drive more buying transformation in the enterprise market. We set a new enterprise revenue record for the March quarter, and we expect this momentum to continue for the remainder of the yearâ€¦.Corporate buyers reported a 96 percent satisfaction rate and a purchase intent of 68 percent for the June quarter,â€ said Maestri.</p><h3><strong>Why is this happening?</strong></h3><p>There are lots of good reasons that Apple has been able to secure its position in the enterprise.</p><p>Six easy reasons include Appleâ€™s first mover advantage, ease of deployment and device configuration, Exchange support, constructive relationships with Microsoft, Cisco, <a href="http://www.applemust.com/this-is-a-big-deal-apple-deloitte-team-for-the-ios-enterprise/">Deloitte</a>, IBM and others, and industry-leading lack of fragmentation.</p><p>Another is the user demographic and their loyalty: While Android-as-a-platform has a larger market share, when it comes to enterprise deployment Apple has the hearts and minds of the high-end smartphone user â€“ and a 92 percent loyalty among those customers.</p><h3><strong>8 more reasons include:</strong></h3><ul> <li><em>Expense</em>: Based on a major deployment of 90,000 Macs, <a href="http://www.computerworld.com/article/3131906/apple-mac/ibm-says-macs-are-even-cheaper-to-run-than-it-thought.html">IBM now claims</a> it costs three times as much to manage Windows PCs as it does Macs.</li> <li><em>Support</em>: iOS 10 runs happily on <a href="https://www.apple.com/uk/ios/ios-10/">iPhone 5</a>, released in September 2012. Other platforms donâ€™t provide support for anything like as long, posing pressure on enterprise IT budgets.</li> <li><em>Security</em>: Appleâ€™s platforms are certainly not immune to cyberattack â€“ but they are regularly patched and seldom subverted. In contrast, some people claim an example of new Android malware is identified every <a href="http://www.techrepublic.com/article/new-android-malware-found-every-10-seconds-report-says/">ten seconds</a>.</li> <li><em>Partnerships:</em> Apple and its integration partners are securing a range of massive deals, not least the recently announced decision by Volkswagen to standardize on use of iPhones across the corporation (reaching a potential 620,000 employees), and Capital Oneâ€™s purchase of iPhones, Macs and Apple Watch for employees. Santander Bank just agreed to deploy over 11,000 iOS devices across the company. United Airlines has deployed <a href="http://www.applemust.com/united-airlines-already-uses-50000-ios-devices-ibm/">50,000 iOS devices</a>.</li> <li><em>Enterprise sales:</em> Appleâ€™s integration partners are putting tonnes of effort into evangelizing the companyâ€™s solutions to the sector. <a href="http://www.computerworld.com/article/2886982/with-ibm-apple-will-own-the-mobile-enterprise.html">IBMâ€™s MobileFirst iOS strategy</a> continues to bear fruit (around c.3k businesses are now using IBM/iOS apps). Deloitte has assigned a colossal 5,000 people to focus on Apple integrations for its enterprise clients and is working to secure over 100 big new opportunities. Cisco is also working to evangelize Apple in the enterprise.</li> <li><em>Developers</em>: To boost its enterprise share, Apple is pushing outside of its own sizable developer community. SAP recently released a tool that makes it much easier for SAP developers to write business solutions for iOS. Smaller groups, including WWT Asynchrony, are also <a href="https://www2.wwt.com/all-blog/wwt-asynchrony-labs-to-test-and-build-transformational-business-solutions-exclusively-for-iphone-and-ipad/">climbing aboard</a>.</li> <li><em>Compromise, and the lack of it</em>: Apple has worked hard to break out of some of the preconceptions levelled against it by critics. It is working with partners, opening up key APIâ€™s to enable solutions integration and development, and working to secure its systems and data integrity with improvements such as Apple File System. This means an enterprise user can look forward to the same quality ease-of-use as a consumer can expect from an Apple system, but boosted by security, performance, and integration advantages pros demand.</li> <li><em>Mobility Partner Program</em>: Apple also <a href="http://www.networkworld.com/article/3163497/ios/apples-mobility-partner-program-comes-out-of-hiding.html">has its own scheme</a> in which it works with developers and master systems integrators to weave its solutions into enterprise deployments.</li> </ul><h3><strong>Servicing success</strong></h3><p>iPad Pro sales to enterprise users are on the rise despite the hype around Surface. 76 percent of organizations claim to have seen an increase in iPad and iPhone adoption, 74 percent are experiencing uptick in Mac use across their organization over the previous year.</p><p>With so many enterprise employees using their devices for both work and play, Appleâ€™s growing services revenue is also <a href="http://www.computerworld.com/article/3184649/apple-is-more-like-harry-potter-than-pixar-says-needham-co.html">likely to see an uptick</a> as the enterprise transformation continues.</p><p><strong>Google+?</strong>Â If you use social media and happen to be a Google+ user, why not joinÂ <a href="https://plus.google.com/u/0/communities/102592251674546201152">AppleHolic''s Kool Aid Corner community</a>Â and join the conversation as we pursue the spirit of the New Model Apple?</p><p><strong>Got a story?Â </strong><a href="https://twitter.com/jonnyevans_cw"><strong>Drop me a line via Twitter</strong></a>Â or in comments below and let me know. I''d like it if you chose to follow me on Twitter so I can let you know when fresh items are published here first on Computerworld.</p> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:26', 0, 'Admin'),
(155, 'CW@50: Vint Cerf on his &#039;love affair&#039; with tech and whatâ€™s coming next', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>When internet pioneer Vinton Cerf was 10, he was working on advanced math, and by the time he was 17, he was tinkering at programming at UCLA and beginning a lifelong "love affair" with computing.</p><p>Today, <a href="http://www.computerworld.com/article/2493539/it-leadership/vint-cerf--nobody-s-too-old-for-tech.html">Cerf</a>, known as the father of the internet, says software bugs are among the biggest dangers to enterprise IT and warns of the mounting challenges the IT community must face in what he calls the "digital dark age."</p><p>Widely recognized for his contributions to technology, Cerf, 73, was awarded the U.S. National Medal of Technology for co-founding and developing the internet. He also was the recipient of the Presidential Medal of Freedom, the A.M. Turing Award and 29 honorary degrees.</p><p>Through the years, Cerf has been on the faculty of Stanford University and was a principal scientist at DARPA, the Defense Advanced Research Projects Agency. At other times in his career he was a systems engineer at IBM and a senior vice president at the former MCI. He is now vice president and chief internet evangelist for Google.</p><aside class="nativo-promo smartphone" id=""> </aside><aside class="fakesidebar"><strong>[ Exclusive transcript: <a href="http://computerworld.com/resources/137665/inside-the-mind-of-internet-pioneer-vinton-g-cerf#tk.ctw-infsb">Vinton G. Cerf complete oral history</a> ]</strong></aside><p><i>Computerworld</i>Â spoke with Cerf as part of its 50th anniversary of covering the tech industry.</p><p>The following is an edited version of reporter Sharon Gaudin''s interview with Cerf, in which he talks about the tech events that have most surprised him, his biggest accomplishment, what worries him and what he expects to come in future technologies.</p><p><strong>Were you a <i>Computerworld</i> reader back in the day?</strong></p><p>Yes. In fact, Iâ€™ve even received a few [IDG] awards and a plaque or two (IDG is the parent company of <em>Computerworld</em>).Â <i>Computerworld</i> was actually a pretty well regarded publication, covering a broad range of topics. If you think about 50 years ago, there werenâ€™t that many [tech publications]. <i>Computerworld</i> was early in the publication cycle.</p><aside class="nativo-promo tablet desktop" id=""> </aside><figure class="large"> <div class="embed-wrapper"> <div class="embed-container"><video id="vid77557" controls="controls" class="embeddedVideo" poster="https://cms-images.idgesg.net/images/article/2017/05/template-c100.00_00_06_25.still001-100722181-orig.jpg" width="562" height="326"> </video></div> </div> </figure><p><strong>How did you get into computer technology?</strong></p><p>I was always interested in science and math from a very early age. When I was 10, I was in fifth grade doing seventh grade algebra. We were blowing things up with chemicals you canâ€™t really get today.</p><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155323863294680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p>By the time 1958 rolled around, my first exposure to a large-scale computing system was Sage at System Development Corp. in Santa Monica, Calif. It was basically â€¦ using radar in northern Canada to try to track Russian bombers coming over the pole. It was so big you had to walk inside it to use it.</p><p>Two years later, while still in high school, my best friend and I got access to the computers at UCLA. That was the beginning of my love affair with computing. My friend and I were programming that machine to do different mathematical calculations.</p><p><strong>[ See more on Computerworldâ€™sÂ <a href="http://www.computerworld.com/category/cw-at-50/#tk.ctw-infsb">CW@50 series</a>. ]</strong></p><p><strong>What were your goals in tech?</strong></p><p>The thing that was the most attractive was that you could create your own little world inside the computer, and it would do what you wanted it to do. I found that ultimately beguilingâ€¦ Something that would happen in a machine in one place caused something to happen thousands of miles away and that was very interesting, too.</p><p>Like a lot of engineers, I liked solving problemsâ€¦ For a significant part of my career, people proposed problems they needed to be solved. Creating the internet was a problem posed by a colleague.</p><p><strong>Do you think that was your greatest accomplishment?</strong></p><p>No. Getting it turned on was a big deal. Keeping it running for the last some odd years was an even bigger deal. Protecting it from hostile governments that want to shut it down and supporting new applications at a higher capacity are all evolutions. The evolution continuesâ€¦ I donâ€™t know if I can point to anything and say thatâ€™s the biggest accomplishment. Itâ€™s one big climb up the mountain.</p><p><strong> Whatâ€™s the next big thing coming down the road?</strong></p><p>The biggest thing on the current horizon is the <a href="http://computerworld.com/category/internet-of-things/">internet of things</a>. While there are all kinds of benefits associated with that, there also are a lot of risks. We see the headlines about these kinds of devices being attacked by hackers. There are all kinds of <a href="http://computerworld.com/article/3180526/security/mirai-is-the-hydra-of-iot-security-too-many-heads-to-cut-off.html">issues of privacy and safety and security</a>.</p><p>Thereâ€™s also A.I. and machine learning. We are finding all kinds of powerful ways of applying those technologies. But I worry about turning over too much autonomous authority to a piece of software.</p><p><strong> Do you have fears about artificial intelligence?</strong></p><p>No, not like <a href="http://www.computerworld.com/article/2922442/robotics/stephen-hawking-fears-robots-could-take-over-in-100-years.html">Stephen Hawking</a> or <a href="http://www.computerworld.com/article/2840815/ai-researchers-say-elon-musks-fears-not-completely-crazy.html">Elon Musk</a>, who are alarmists about artificial intelligence. Every time you use Google search or self-driving cars, youâ€™re using A.I. These are all assistive technologies and I suspect this is how it will be used.</p><p><strong>What are some of the biggest changes youâ€™ve seen in technology in the past 50 years?</strong></p><p>Weâ€™ve gone from the integrated circuit to chips that have 14 billion transistors. The feature sizes are down in the single digit nanometers, which is simply unbelievable. Weâ€™re at the point where the density and yield of these chips is beyond anyoneâ€™s expectations.</p><p>And the development of <a href="http://www.computerworld.com/article/2488708/high-performance-computing-quantum-rewrites-the-rules-of-computing.html">quantum computers</a>. Weâ€™re pretty confident the hybrid quantum and traditional computer will yield significant results.</p><p><strong>What have been some of the biggest surprises that youâ€™ve seen?</strong></p><p>The biggest surprises have been with the <a href="http://www.computerworld.com/article/3040563/enterprise-applications/5-things-you-need-to-know-about-ai-cognitive-neural-and-deep-oh-my.html">neural network</a>. A 150-layer neural network is pretty astonishing. When using the neural network to detect diabetic neuropathy, computers did better than experts did.</p><p><strong>Whatâ€™s the biggest issue facing IT today?</strong></p><p>The biggest issue right now has to do with software that has bugs. This is a serious problem because for all the 70-plus years of writing software, no one has been able to do it without writing bugs. We really need tools to help programmers avoid making mistakes.</p><p><strong>What will be ITâ€™s biggest problem in another 10 years?</strong></p><p>Itâ€™ll be the same damn problem. I donâ€™t think weâ€™ll solve the bug problem in another 10 years. I wish I could say otherwise. I hope Iâ€™m wrong about that. In the meantime, weâ€™ll be using artificial intelligence programs to try to detect if other programs are doing something they arenâ€™t supposed to do. Kind of an amusing idea to set a computer to watch another computer.</p><p><strong>What worries you going forward?</strong></p><p>The obvious thing that worries me is malware and other abusive behaviors, like denial-of-service attacks and penetrations. All those bad things are the result of people who donâ€™t have your best interests in mind. People havenâ€™t changed. Thatâ€™s why we still like Shakespeare.</p><p>People have found new ways of being harmful and we have to invent both technical and legal means to limit the damage they can cause.</p><p><strong>Whatâ€™s the most important invention or advancement that has come out of DARPA?</strong></p><p>My favorite one would be the internet, though Iâ€™m obviously biased. They have done some extraordinary work with <a href="http://computerworld.com/article/2893753/darpa-sets-finalists-for-high-risk-high-reward-robotics-challenge.html">robotics</a>, especially in the area of prosthetics.</p><p>They also have made significant contributions in computer security and have long been supporters of artificial intelligence. They were in on that game more than 50 years ago.</p><p><strong>What do you see for the future of the internet?</strong></p><p>Weâ€™re looking at the digital dark age. Weâ€™re generating huge amounts of digital content all the time. Weâ€™re tweeting and blogging and taking photos and making spreadsheets and making movies. To see them or interact with them, we need software. Will that software be available 100 years from now or 500 years from now?</p><p>I worry 100 years from now our descendants may not know much about us or be able to read our emails or tweets or documents because nobody saved them or the software you need to read them wonâ€™t exist anymore.</p><p>Itâ€™s a huge issue.</p><p>I have files of text that were written 20 years ago in WordPerfect, except I donâ€™t have WordPerfect running anywhere. We have a lot of work ahead of us to preserve digital content over a long period of time.</p><p><strong>Finally, what is ahead of us that you are the most excited about?</strong></p><p>Iâ€™m not excited that I probably donâ€™t have another 50 years left, unless Ray Kurzweilâ€™s <a href="http://www.computerworld.com/article/2528330/app-development/nanotech-could-make-humans-immortal-by-2040--futurist-says.html">predictions</a> come true, and I can upload my consciousness into a computer.</p> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:26', 0, 'Admin');
