(156, 'WD aims to tame growing data needs with latest enterprise SAS SSD', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>With data centers seeing rapid data growth, Western Digital Corp. (WD) has announced its highest performing 2.5-in. small form-factor SAS SSD. The drive is aimed at helping companies deal withÂ increasing needs for virtualized storage systems, online transaction processing, database analytics and private and hybrid clouds.</p><p>WD''s <a href="http://www.hgst.com/products/solid-state-solutions/ultrastar-ss300" target="_blank">Ultrastar SS300</a>,Â developed in partnership with Intel, uses a 12Gbps SAS interface and sports sequential read/write speeds up to 2.1GBps and 2.05GBps, respectively; the drive also offers random read/write input/output per second (IOPS) of up to 400,000 and 200,000, respectively.</p><p>"SAS SSD adoption continues to see strong growth across a variety of critical enterprise applications," said Gregory Wong, principal analyst at Forward Insights. "Western Digital''s newest 12Gbps SAS SSD, the Ultrastar SS300, offers the optimum balance of performance, capacity and cost for the most demanding workloads,"</p><p>The drive is available with multi-level cell (MLC) NAND flash in capacities ranging from 400GB to 3.2TB, or triple-level cell (TLC) NAND flash available in capacities ranging from 480GB to 7.68TB. MLC NAND stores two bits and TLC stores three bits per transistor, requiring more sophisticated wear-leveling and error correction software while enabling greater densities.</p><aside class="nativo-promo smartphone" id=""> </aside><p>Users can choose the SSD in 9 Watt, 11 Watt or 14 Watt options, depending on their power requirements.</p><p>The drive also takes advantage of Intel''s 3D NAND technology, which stacks flash cells one atop another like microscopic skyscrapers, enabling vastly greater drive densities that drastically reduce production costs.</p><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155325782544680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p>The Ultrastar SS300 comes with four endurance choices that range from half a full drive write per day to 10 full drive writes in the same period. The Ultrastar SS300 also boasts a 0.35% annual failure rate (AFR) or 2.5 million hours mean-time between failure (MTBF), according to WD.</p><p>For example, the 3.2TB version of the Ultrastar SS300 set at 10 full drive writes per day can endure up to 59 petabytes of random writes over its life. That''s the equivalent of writing 16TB of data a day for five years.</p><aside class="nativo-promo tablet desktop" id=""> </aside><p>The Ultrastar SS300''s predecessor -- <a href="https://www.hgst.com/company/media-room/press-releases/hgst-expands-enterprise-sas-ssd-storage-portfolio-for-data-intensive-application-acceleration" target="_blank">the Ultrastar SSD1600MR</a> -- offered up to three full drive writes per day for five years and had top sequential read/write speeds of up to 1100MBps and 700MBps, respectively. It delivered up to 130,000 random read and 30,000 random write IOPS.</p><p>WD said it has significantly enhanced the Ultrastar SS300, particularly around random performance, gearing it specifically for the predominant applications used in environments such as virtualized storage systems, databases and private and hybrid cloud.</p><p>The drive also offers a choice of data security options that include Instant Secure Erase, Self-Encrypting Drive capability that''s compliant with the TCG Enterprise specification and FIPS 140-2 certification.</p><p>The Ultrastar SS300 is shipping to equipment manufacturers only, and as a result, WDC isn''t disclosing pricing. The company said the SSD will be available as an option from various partner vendors in support next-generation data center storage arrays.</p> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:27', 0, 'Admin'),
(157, 'Echo who? Google just turned Home into a productivity powerhouse', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>Remember last week, when Amazon <a href="http://www.computerworld.com/article/3195340/artificial-intelligence/amazon-echo-show-google-home.html">added "calling capabilities"</a> into its Echo smart speaker?</p><p>Yeah...that was cute.</p><p>At the keynote of its Google I/O developers'' conference Wednesday, Google announced a handful of updates to its <a href="http://www.computerworld.com/article/3166451/artificial-intelligence/google-home.html">Google Home</a> smart speaker -- and these are no incremental improvements. The updates collectively transform the device from a sometimes-useful novelty into a powerful productivity tool -- one that holds practical appeal for both the home and the workplace, and one that makes Amazon''s little gizmo look like child''s play.</p><p>Huh. <a href="http://www.computerworld.com/article/3195340/">Who woulda thunk?</a></p><aside class="nativo-promo smartphone" id=""> </aside><p>The most noteworthy change coming to Home -- via an automatic update that''ll hit devices sometime in the "next few months" -- is a native hands-free calling feature that effectively turns the product into a simple and fee-free speakerphone. And we''re talking a <em>real</em> phone here -- one that lets you make actual calls to landlines and cell phones (within the U.S. and Canada), not just internet calls to other people who have the same device or are using some out-of-the-way app (sorry, Amazon).</p><figure class="large"> <div class="embed-wrapper"> <div class="embed-container embed-youtube"> <div style="position: relative; height: 0; padding-bottom: 56.25%;"><iframe style="position: absolute; width: 100%; height: 100%; left: 0;" src="https://www.youtube.com/embed/xqH2PYfbJMU?ecver=2" width="700" height="360" frameborder="0" allowfullscreen="allowfullscreen"> </iframe></div> </div> </div> </figure><p>Google Home''s calling system can either use a private number or have the calls originate from your own regular mobile digits. Aside from that (optional) choice, Google says there''s no setup required and no need to use any special app or connection; all you''ve gotta do is tell Home to make a call, and it''ll start dialing.</p><p>Oh, and one more thing: Thanks to Home''s recently added multi-user support, which identifies different people <a href="https://blog.google/products/assistant/tomato-tomahto-google-home-now-supports-multiple-users/" target="_blank">based solely on the sound of their voice</a>, the calling function will be able to work with multiple sets of contacts and numbers. So if, for instance, I say "Hey Google, call Mom," my Home would know it''s me talking and would place a call to <em>my</em> mother using <em>my</em> mobile phone number. If my wife uttered the same phrase, it''d call <em>her</em> mama from <em>her</em> number.</p><p>Not too shabby, right?</p><aside class="nativo-promo tablet desktop" id=""> </aside><aside class="fakesidebar"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155325965934680" target="_blank">Computerworld''s Facebook page</a>. ]</strong></aside><p>Cool factor aside, though, stop for a second and think about just how valuable such a setup could be. Even if you forget about all its other home control and <a href="http://www.computerworld.com/article/3178422/android/google-assistant-android.html">Assistant-oriented features</a>, Google Home is now a self-contained speakerphone system -- one with a really good and impressively loud speaker, yes, but more significantly one that can make calls from a private number or your own number simply by being plugged into any ol'' electrical outlet. And it can work intelligently for multiple people in a way that almost seems like science fiction.</p><aside class="pullquote"><q>Google just catapulted itself into a completely different league of product</q></aside><p>On the home front, that gives you an insanely convenient way to make high-quality hands-free calls without having to have your phone nearby or use up any of your precious mobile minutes (assuming you''re on a plan that isn''t unlimited). And on the business side of the equation -- especially within the small business realm -- it offers an affordable option for putting a ready-to-roll speakerphone in any office without any wiring hassles or ongoing fees. In either scenario, you could make the calls personalized or anonymous, depending on your needs.</p><p>In the still-young field of smart speakers, this is -- dare I say -- <em>revolutionary</em>. And it gives Google a competitive advantage that''s gonna be tough for Amazon to match.</p><h3>But wait -- there''s more!</h3><p>Calls aside, the newly announced upgrade will bring Home a handful of other interesting flourishes. First, Home devices will soon harness your existing smartphone and TV screens to provide visual accompaniments to responses, as appropriate -- sending directions to your phone when you ask about the location of a business, for instance, or showing your calendar on a Chromecast-connected TV when you ask to see your agenda. It''s a clever and very Googley way to accomplish what Amazon could do only by creating an <a href="https://www.amazon.com/Amazon-MW46WB-Introducing-Echo-Show/dp/B01J24C0TI?tag=computerworld0e-20" target="_blank">entirely new (and rather clunky-looking) product</a>.</p><p>Home will also soon gain what Google calls a "proactive assistance" feature. In short, the device will flash its lights when a timely and important message awaits -- like a pending reminder, a traffic delay relevant to your day at any given moment, or a status change for a flight you''ve booked (assuming you have the itinerary saved in your Gmail account, where Google can see it). When you see the lights flashing, you simply say "Hey Google, what''s up?" to get the info.</p><p>And in a "What took them so long to do <em>this</em>?" twist, Home will soon allow you to schedule calendar appointments as well as set and review reminders -- the same reminders that are synced to your phone and accessible within numerous other Google products. That''s tapping into a powerful ecosystem with a reach no other company can claim.</p><p>Last week, I said that Amazon had raised the stakes with its launch of the screen-packing and limited-"call"-making Echo Show device -- and it certainly did. But with this week''s Home announcements, Google just catapulted itself into a completely different league of product.</p><p>For the first time, the smart speaker is looking less like a toy and more like a versatile and valuable appliance. And if the pace of improvements Google''s kept up over these first six months is any indication, what we''re seeing now is almost certainly just the start.</p><figure class="large"><a href="https://twitter.com/androidintel" target="_blank"><img src="http://images.techhive.com/images/article/2016/11/android-intelligence-twitter-100694107-orig.jpg" border="0" alt="Android Intelligence Twitter" width="620" height="57"/></a></figure> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:27', 0, 'Admin'),
(158, 'Going interstellar with Microsoft Cosmos', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>At <a href="https://build.microsoft.com/" target="_blank">Microsoftâ€™s Build developer conference</a> last week, the company announced <a href="http://www.pcworld.com/article/3196015/cloud-computing/microsoft-takes-its-databases-worldwide-with-cosmos-db.html" target="_blank">Cosmos DB,</a> a new cloud database offering that, if you believe the hype, entirely changed the database game. Before reelecting on what this means for developers and organizations, itâ€™s worth taking a look at what Cosmos is.</p><p><a href="https://azure.microsoft.com/en-us/services/cosmos-db/" target="_blank">Cosmos</a> is a schema-free database service built with the aim of delivering high performance, fault tolerance, automatic indexing of data and truly globally distributed scalability. Cosmos is, at least in part, the evolution of Microsoftâ€™s previous DocumentDB offering. DocumentDB was Redmondâ€™s first foray into the <a href="https://docs.microsoft.com/en-us/azure/documentdb/documentdb-sql-query" target="_blank">NoSQL world</a>. And while DocumentDB was a NoSQL choice in contrast to Microsoftâ€™s relation offerings, Cosmos DB is multi-modal, offering developers the options to store relational or non-relational data. <a href="https://twitter.com/scottgu" target="_blank">Scott Guthrie</a>, Microsoftâ€™s perennially red-shirted Executive Vice President of the Cloud and Enterprise group, described Cosmos as,Â â€œthe first globally distributed, multi-model database service delivering turnkey global horizontal scale out with guaranteed uptime and millisecond latency at the 99th percentile.â€</p><p>Cosmos is actually the descendant of The Florence Project, an initiative started seven years ago as a prototypical and globally distributed database. Florence eventually saw the light of day as <a href="https://docs.microsoft.com/en-us/azure/documentdb/documentdb-introduction" target="_blank">DocumentDB</a> and, three years after that launch, now has morphed into <a href="https://docs.microsoft.com/en-us/azure/cosmos-db/introduction" target="_blank">Cosmos DB</a>. Now Cosmos is a significant extension of DocumentDB which was essentially a store for <a href="https://docs.microsoft.com/en-us/sql/relational-databases/json/json-data-sql-server" target="_blank">JSON data</a>. Cosmos extends the idea of an index-free database system and also has support for various new data types that can work as a graph database or key-value database. In a case of Microsoft meeting the developers wherever they are and however they work, Cosmos supports <a href="https://www.microsoft.com/en-us/sql-server/" target="_blank">SQL</a>, <a href="https://docs.microsoft.com/en-us/azure/cosmos-db/graph-introduction" target="_blank">Gremlin</a>, <a href="https://azure.microsoft.com/en-us/services/storage/tables/" target="_blank">Azure Tables</a> and other driver and translation choices.</p><p>Alongside the global nature of Cosmos, it also offers the notion of tunable consistency. Whereas most competitive database offerings offer only strong or eventual regularity, Cosmos offers five different flavors of consistency depending on developer requirements. For those not <em>au fait</em> with the world of databases, <a href="https://docs.microsoft.com/en-us/azure/documentdb/documentdb-consistency-levels" target="_blank">strong consistency</a> is a notion in which, whenever data is written to a database, all the different nodes, wherever they may physically be, have to agree on a new value before it becomes visible. Obviously there are some performance trade-offs in this situation. Eventual consistency, by contrast, is a more lenient system where the nodes donâ€™t update simultaneously and, instead, come to agree on a value over time â€” after there hasnâ€™t been any recent updates of data.</p><aside class="nativo-promo smartphone" id=""> </aside><p>In terms of availability, Cosmos is generally available already across all of the 34 Azure regions. Existing DocumentDB customers, alongside the data stored in DocumentDB, are automatically migrated over to Cosmos. Users can set up a new Cosmos database through the regular Azure control panels, and developers can chose from two general release APIs â€” <a href="https://docs.microsoft.com/en-us/azure/documentdb/documentdb-protocol-mongodb" target="_blank">MongoDB</a> and SQL. Graph and key-value APIs, however, are only available as previews.</p><p>While all 34 Azure regions can host Cosmos databases, a single database can be spread across a total of nine data center regions. Additionally, and no-doubt attractive to those who are sensitive about geographical peculiarities, users can target both reads and writes to individual regions.</p><p>Microsoft pitches Cosmos as a killer offering that resolves some of the problems its competitorsâ€™ proposals face â€” namely scaling issues, in the case of Aurora, and incompatibility, in the case of Googleâ€™s recently released database product, Spanner. Differentiation, however, is both debatable and a point-in-time advantage, and you can be sure that both AWS and Google watched the Cosmos launch with interest and will resolve any shortcomings their offerings may have.</p><p>While there was some chatter at the launch that Cosmos is simply DocumentDB with a different name, a number of developers I spoke with indicated that, in their view, it is a compelling offering, and one which, at first blush, offers some real advantages. The ball is now, it would seem, in the courts of AWS and Google.</p><aside class="nativo-promo tablet desktop" id=""> </aside> <p><strong>This article is published as part of the IDG Contributor Network. <a href="/contributor-network/signup.html">Want to Join?</a></strong></p> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:28', 0, 'Admin'),
(159, 'Google Assistant for iPhone: An enterprise perspective', '<div id="drr-container" class=''cat'' itemprop="articleBody"> <p>Google I/O saw a range of Google announcements, from the introduction of a low-end Android O OS for low-end phones to the introduction of new software designed to challenge Siri on iPhone, <a href="https://itunes.apple.com/us/app/the-google-assistant-get-help-anytime-anywhere/id1220976145?ls=1&amp;mt=8">Google Assistant for iPhone</a>.</p><h3><strong>Google Assistant</strong></h3><p>Appleâ€™s ads-focused competitor is playing a strong move with this release.</p><p>The company hopes to exploit existing public perception that Siri isnâ€™t such a great voice assistant by launching its own assistant at Appleâ€™s platform. Time â€“ and any <a href="http://www.applemust.com/siri-will-know-you-better-than-you-do/">Siri improvements announced at WWDC</a> â€“ will tell us if it succeeds in this.</p><p>Presently available only in the U.S., Google Assistant lets you use your voice to request Google searches and control services, including smart home devices.</p><aside class="nativo-promo smartphone" id=""> </aside><p>You can use it to make calls, send messages and emails, set reminders and events, play YouTube music, get navigation advice, and search for the answers to questions.</p><p>It is an app, which means you need to activate it to use it just as you do any app on iOS. That''s different from Siri on iOS, which is built inside the operating system so you can access it without needing to open the app. Curiously, Assistant can do one thing Siri inexplicably cannot do -- which is to turn on your flashlight.</p><h3><strong>Enterprise pros and cons</strong></h3><p>Enterprise users, particularly developers, may also be interested to learn that Google has introduced a software development kit they can use to build apps that integrate with Google Assistant.</p><p>What else do enterprise users who are building their digital transformation strategy around Apple and iOS need to know about Googleâ€™s new toy?</p><aside class="nativo-promo tablet desktop" id=""> </aside><p>There are a few reasons enterprise users may be wary of jumping too fast to allow employees to install the new software on their iPhones, particularly those used to share and/or access confidential information.</p><p>It is fortunate that most digital transformation leaders in the C-suite are already too wary to simply extend their existing security policy in order to support any new software, particularly software that by its nature demands potentially valuable information be shared with a third-party server outside of corporate control.</p><h3><strong>CIO check list</strong></h3><p>CIOs will need to think about the following when considering the potential of permitting use of Google Assistant on iPhones:</p><ul> <li><em>The size:</em> The app weighs in at 256MB. This is by no means a deal-breaker, but it may challenge enterprise-wise deployments that use low capacity iPhones.</li> <li><em>Battery life impact:</em> We know from using Facebook, Twitter, and other powerful social media apps that solutions that update themselves regularly can become battery life hogs. Now, Google Assistant has only been available for a short time and I canâ€™t speak to how much energy the app consumes, but itâ€™s going to make little sense revising existing protocols to enable use of this app if it means your mobile workers see a big impact on power requirements.</li> <li><em>Google Account:</em> To use Google Assistant on an iPhone employees will need to sign-in with their Google account. Now, security policy differs across every enterprise: Those using Google Docs will probably be fine with this, but others, particularly those standardized around secure proprietary technologies, or those subject to regular hacker probes and/or phishing attacks may want be hesitant to link their systems up to a world-facing service.</li> <li><em>Settings and security:</em> In a sense, being able to run Google Assistant on an iPhone should bring you all the advantages of Google services alongside the arguably superior security of iOS. However, when you use Google Assistant on your iPhone you will be asked to give the app permission to: <ul> <ul> <li>Additional Web and app activity,</li> <li>Location history,</li> <li>Device Information,</li> <li>Voice and audio activity</li> <li>Use your microphone</li> </ul> <li>Any or all of these may be red flags for many enterprise users. I know that use of location-based services is a no-no in some (though not all) deployments. You control <a href="https://support.google.com/assistant/answer/7126196?hl=en&amp;ref_topic=7110546&amp;co=GENIE.Platform%3DiOS&amp;oco=0">data gathered by Google Assistant here</a>.</li> </ul> </li> </ul><h3>Conclusion</h3><p>Now Assistant is available on iOS, will Apple bring Siri to Android?</p><p>I doubt it, but as both firms invest heavily in machine intelligence and AI, it will be interesting to see which of these two services (and Cortana, which is also available on iOS) will still be seen as the best available voice assistant in 12-months.</p><p>Thatâ€™s great for consumer users, but enterprise chiefs will likely want to think a little more deeply before adding support to Googleâ€™s tool to their security policy.</p><h4><strong>Will you use Google Assistant on your iPhone? <a href="http://www.applemust.com/poll-will-you-use-google-assistant-on-your-iphone/">Let us know in this poll</a>.</strong></h4><p><strong>Google+?</strong>Â If you use social media and happen to be a Google+ user, why not joinÂ <a href="https://plus.google.com/u/0/communities/102592251674546201152">AppleHolic''s Kool Aid Corner community</a>Â and join the conversation as we pursue the spirit of the New Model Apple?</p><p><strong>Got a story?</strong><strong>Â </strong><a href="https://twitter.com/jonnyevans_cw"><strong>Drop me a line via Twitter</strong></a>Â or in comments below and let me know. I''d like it if you chose to follow me on Twitter so I can let you know when fresh items are published here first on Computerworld.</p> <div class="end-note"> <!-- blx4 #2006 blox4.html  --> </div> </div>', '2017-05-25 23:21:28', 0, 'Admin'),
